module.exports = "<link\r\n  rel=\"stylesheet\"\r\n  href=\"https://use.fontawesome.com/releases/v5.6.1/css/all.css\"\r\n  integrity=\"sha384-gfdkjb5BdAXd+lj+gudLWI+BXq4IuLW5IT+brZEZsLFm++aCMlF1V92rMkPaX4PP\"\r\n  crossorigin=\"anonymous\"\r\n/>\r\n\r\n<!-- Header Banner -->\r\n\r\n<section id=\"headerBannerId\">\r\n  <div class=\"header-banner-container\">\r\n    <div class=\"container\">\r\n      <h3>HOW IS THE PROPERTY MANAGED?</h3>\r\n      <p>\r\n        Key Lobby handles the set-up and management for every property in the\r\n        Partbnb portfolio. Read on to find out more about how this local\r\n        property management company cares for your investment.\r\n      </p>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- Header Banner end -->\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <h3>Overview</h3>\r\n      <p>\r\n        With almost five years experience and a growing network of properties,\r\n        Key Lobby is a true top performer in the property management industry.\r\n        Recently, they’ve become the sole management company for Partbnb,\r\n        focusing on the Caribbean market.\r\n      </p>\r\n      <p>\r\n        The Key Lobby team prides themselves on providing a fantastic service\r\n        for not only the property owners, but their future guests. Their hard\r\n        work and dedication shine through in every glowing client testimonial on\r\n        their website. If you have any questions about Key Lobby or the process\r\n        we follow to prepare your property for the market, feel free to contact\r\n        our team.\r\n      </p>\r\n      <p>\r\n        Key Lobby have great testimonials from their clients which made our\r\n        decision easy, check out their testimonial section on their website or\r\n        talk to our team if you have any questions\r\n      </p>\r\n      <div class=\"row\">\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-occupancy-icon></app-occupancy-icon>\r\n                  <h3>Property Setup</h3>\r\n                  <p>\r\n                    It is essential that the property is set up to be suitable\r\n                    for short term accommodation. KeyLobby provides a\r\n                    full-service approach, from choosing the right locks and\r\n                    monitoring equipment to ordering the best furniture and\r\n                    amenities. They also ensure that each item is placed in the\r\n                    right areas throughout the house.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-guest-inquiries-padding\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-listing-icon></app-listing-icon>\r\n                  <h3>Guest Inquiries</h3>\r\n                  <p>\r\n                    A management company that can turn enquiries into confirmed\r\n                    bookings is crucial. KeyLobby excels at converting even the\r\n                    most unlikely of general questions into complete bookings.\r\n                    Managing bookings is one of the most time-consuming tasks of\r\n                    running a short term rental, and KeyLobby takes away this\r\n                    hassle for owners.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-during-the-stay\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-checkin-icon></app-checkin-icon>\r\n                  <h3>During the stay</h3>\r\n                  <p>\r\n                    KeyLobby is available on a 24/7 basis to respond quickly to\r\n                    any issues via email or phone. Property visits, cleaning,\r\n                    and maintenance are conducted regularly. Should problems\r\n                    arise, a team of experts is on-hand to tackle emergency\r\n                    requests.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-guest-listing-experts\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-listing-icon></app-listing-icon>\r\n                  <h3>Listing Experts</h3>\r\n                  <p>\r\n                    Having the property setup correctly online is essential when\r\n                    it comes to attracting renters. The KeyLobby team ensures\r\n                    that your property details are accurate and engaging.\r\n                    Properties need to be accurately and continuously priced\r\n                    online throughout different seasons of the year to ensure\r\n                    that the property is generating great occupancy and returns\r\n                    for its owners. <br /><br />\r\n                    KeyLobby pricing pros utilize the latest in technology from\r\n                    AirDNA to accurately price property listings.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<section id=\"footerBannerId\">\r\n  <div class=\"bottom-banner\">\r\n    <div class=\"container\">\r\n      <h3>Visit the Keylobby Website</h3>\r\n      <br />\r\n      <br />\r\n      <a href=\"https://www.keylobby.com\" class=\"btn btn-lg btn-success\"\r\n        >Click here to visit</a\r\n      >\r\n    </div>\r\n  </div>\r\n</section>\r\n"

