module.exports = "<!-- Header Banner -->\r\n\r\n<section id=\"headerBannerId\">\r\n  <div class=\"header-banner-container\">\r\n    <div class=\"container\">\r\n      <h3>OUR FEES</h3>\r\n      <p>\r\n        It is important to us that we are transparent on all fees and costs\r\n        associated with the use of the Partbnb Platform. Feel free to contact\r\n        our team with any additional questions.\r\n      </p>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- Header Banner end -->\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <div class=\"row\">\r\n        <div class=\"col-md-12\">\r\n          <h3>Platform Fees</h3>\r\n          <div class=\"second-card\">\r\n            <div class=\"card\">\r\n              <div class=\"card-body\">\r\n                <div class=\"card-body-container\">\r\n                  <div class=\"center-text\">\r\n                    <h3>Buying / Selling of any Partbnb shares</h3>\r\n                    <h2 class=\"rate-header\">1.75%</h2>\r\n                    <p>\r\n                      if you are buying or selling parts on the platform, there\r\n                      will be a 1.75% transaction fee added to your order. For\r\n                      example, if you <br />\r\n                      are buying 10 parts at $33.00 then your total order is\r\n                      $330, and your transaction fee will be $5,78 ($330 *\r\n                      1.75%). The total <br />\r\n                      charged will be $335.78\r\n                    </p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <h3>Other Costs / Fees to Consider</h3>\r\n      <div class=\"row\">\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-keylobby-icon></app-keylobby-icon>\r\n                  <h3>\r\n                    Keylobby Property Development /<br />\r\n                    Management\r\n                  </h3>\r\n                  <p>\r\n                    The company that manages the property(KeyLobby) charges a\r\n                    15% fee(on gross revenue) to manage the property. This cost\r\n                    is built into the financial projections / statements of all\r\n                    listed properties. <br /><br />\r\n                    During the development phase of the property, KeyLobby will\r\n                    charge a development fee to perform the aquisition of the\r\n                    property, renovation work and set up to list the property as\r\n                    a short term rental.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-ach-icon></app-ach-icon>\r\n                  <h3>ACH/Wire Transfer Fees</h3>\r\n                  <p class=\"card-bottom-second\">\r\n                    If you choose an ACH transfer there is a $5 transfer fee to\r\n                    send / receive funds (or 5% if under $100). <br />\r\n                    <br />\r\n                    Some banks will charge you a fee to initiate a Wire Transfer to us (please <br />\r\n                    check with your provider). <br />\r\n                    <br />\r\n                    If you have any questions in relations to fees or costs, please contact our team using Live Chat, or email us - team@partbnb.com\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- <section id=\"footerBannerId\">\r\n  <div class=\"bottom-banner\">\r\n    <div class=\"container\">\r\n      <h3>Still not sure if this type of investment suits you?</h3>\r\n      <p>\r\n        Let us know what you need. Our team of experts are always on the go\r\n        helping you out!\r\n      </p>\r\n      <button class=\"btn btn-primary btn-lg\">Talk to Our Team</button>\r\n    </div>\r\n  </div>\r\n</section> -->\r\n"

