module.exports = "<div class=\"header-banner\">\r\n  <div class=\"container\">\r\n    <div class=\"header-wrapper\">\r\n      <h4>Explore our exquisite selection of Caribbean seaside homes</h4>\r\n      <p>See how affordable they are with our unique part ownership program. Contact us about the home you fall in love\r\n        with. We’ll make it easy for you to buy part of it – and start to feel at home in the Caribbean for six weeks a\r\n        year!</p>\r\n    </div>\r\n  </div>\r\n</div>\r\n<div class=\"properties-head-container\">\r\n  <div class=\"container\">\r\n    <div class=\"title\" [ngClass]=\"{ 'collapse-filter': filterCollapse }\">\r\n      <h2>Browse Listing</h2>\r\n    </div>\r\n    <div>\r\n      <div class=\"properties-buttons-mobile\">\r\n        <div class=\"button-status\">\r\n          <pg-select class=\"toggler yellow\" [(ngModel)]=\"propertyStatus\" [PlaceHolder]=\"''\"\r\n            [customIcon]=\"'toggler-yellow'\" (ngModelChange)=\"\r\n        updatePropertiesFilter(countrySortSelected, latestListingSelected, propertyStatus)\r\n      \">\r\n            <pg-option *ngFor=\"let option of statuses\" [Label]=\"option.propertyStatusFilterName\"\r\n              [Value]=\"option.propertyStatusFilterID\">\r\n            </pg-option>\r\n          </pg-select>\r\n        </div>\r\n        <div class=\"svg-filter\">\r\n          <icon-filter-yellow class=\"svg-icon d-xl-none d-lg-none d-md-none d-block\" (click)=\"openMobileFilter()\">\r\n          </icon-filter-yellow>\r\n        </div>\r\n      </div>\r\n      <div class=\"properties-buttons-wrapper collapse\" [ngClass]=\"{ show: !filterCollapse }\">\r\n        <div class=\"button-col filter\">\r\n          <pg-select class=\"toggler yellow\" [(ngModel)]=\"propertyStatus\" [PlaceHolder]=\"''\"\r\n            [customIcon]=\"'toggler-yellow'\" (ngModelChange)=\"\r\n          updatePropertiesFilter(countrySortSelected, latestListingSelected, propertyStatus)\r\n        \">\r\n            <pg-option *ngFor=\"let option of statuses\" [Label]=\"option.propertyStatusFilterName\"\r\n              [Value]=\"option.propertyStatusFilterID\">\r\n            </pg-option>\r\n          </pg-select>\r\n        </div>\r\n        <div class=\"d-flex select\">\r\n          <div class=\"button-col\">\r\n            <pg-select class=\"button-col-item\" [(ngModel)]=\"countrySortSelected\" [PlaceHolder]=\"'Select Country'\"\r\n              (ngModelChange)=\"\r\n            updatePropertiesFilter(countrySortSelected, latestListingSelected, propertyStatus)\r\n          \">\r\n              <pg-option *ngFor=\"let option of countrySortOptions\" [Label]=\"option.countryName\"\r\n                [Value]=\"option.countryId\" [Disabled]=\"option.disabled\">\r\n              </pg-option>\r\n            </pg-select>\r\n          </div>\r\n          <div class=\"button-col\">\r\n            <pg-select class=\"button-col-item\" [(ngModel)]=\"latestListingSelected\" [PlaceHolder]=\"'Latest Listing'\"\r\n              (ngModelChange)=\"\r\n            updatePropertiesFilter(countrySortSelected, latestListingSelected, propertyStatus)\r\n          \">\r\n              <pg-option *ngFor=\"let option of latestListingOptions\" [Label]=\"option.label\" [Value]=\"option.value\"\r\n                [Disabled]=\"option.disabled\">\r\n              </pg-option>\r\n            </pg-select>\r\n          </div>\r\n        </div>\r\n        <div class=\"d-flex\">\r\n          <!-- <div class=\"button-col all\" *ngIf=\"hideOtherFilters\">\r\n            <button class=\"btn button-col-item\" (click)=\"setUIBack()\">\r\n              All Properties\r\n            </button>\r\n          </div> -->\r\n          <div class=\"button-col map-btn\" [ngClass]=\"{ 'show' : !mapClose}\">\r\n            <button class=\"btn button-col-item\" (click)=\"mapClose = !mapClose\">\r\n              <!-- <icon-eye *ngIf=\"mapClose\"></icon-eye>\r\n              <icon-eye-close *ngIf=\"!mapClose\"></icon-eye-close> -->\r\n              <icon-view-orange class=\"icon-md-1 mr-1\" *ngIf=\"mapClose\"></icon-view-orange>\r\n              <icon-not-view-white class=\"icon-md mr-1\" *ngIf=\"!mapClose\"></icon-not-view-white>\r\n              {{ mapClose ? \"Show\" : \"Hide\" }} Map\r\n            </button>\r\n          </div>\r\n          <div class=\"button-col favorites-btn\" [ngClass]=\"{ 'show' : showFavourite}\">\r\n            <button class=\"btn button-col-item\" (click)=\"propertyFavoriteFilter()\">\r\n              <icon-favourited-white class=\"icon-md mr-1\" *ngIf=\"showFavourite\"></icon-favourited-white>\r\n              <icon-favourited-orange class=\"icon-md mr-1\" *ngIf=\"!showFavourite\"></icon-favourited-orange>\r\n              {{ showFavourite ? 'Hide' : 'Favorites' }}\r\n            </button>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"google-map-wrapper\" [ngClass]=\"mapClose ? 'map-close' : 'map-open'\">\r\n  <div class=\"container\" *ngIf=\"propertiesForMap\">\r\n    <google-map [PropertyLocations]=\"propertiesForMap\" [HideMarker]=\"isPropertiesEmpty\" [IsForPropertyDetails]=\"isForPropertyDetails\"></google-map>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"properties-container container\" [ngClass]=\"{ 'mt-2': !mapClose }\">\r\n  <div class=\"row\" [hidden]=\"isLoading\">\r\n    <div class=\"col-lg-4 col-md-6 col-sm-12 col-12 property-item\" *ngFor=\"let property of properties\">\r\n      <div class=\"property-card\">\r\n        <div class=\"property-image\">\r\n          <ngx-slick-carousel (click)=\"viewDetails(property.propertyId, !isLogin)\" class=\"carousel\"\r\n            #slickModal=\"slick-carousel\" [config]=\"slideConfig\" (afterChange)=\"afterChange($event)\"\r\n            (beforeChange)=\"beforeChange($event)\">\r\n            <div ngxSlickItem *ngFor=\"let slide of property.propertyAssets\" class=\"slide\"\r\n              [ngStyle]=\"setPropertyImage(slide.filePath)\">\r\n            </div>\r\n          </ngx-slick-carousel>\r\n          <div class=\"property-image-info\">\r\n            <div class=\"header-info\">\r\n              <div class=\"status\" [ngClass]=\"property.propertyStatusName\">\r\n                {{property.statusFilterName}}\r\n              </div>\r\n              <div class=\"info\" [hidden]=\"property.propertyStatusId === 1 && !property.openDate\">\r\n                {{propertyInfoDate(property)}}\r\n              </div>\r\n              <div class=\"right\">\r\n                <button class=\"btn header-button\" [ngClass]=\"{ 'favorite' : property.favorite }\"\r\n                  (click)=\"addPropertyToFavorite(property)\">\r\n                  <icon-unfavourited class=\"favorite\" *ngIf=\"!property.favorite\"></icon-unfavourited>\r\n                  <icon-favourited-orange class=\"favorite\" *ngIf=\"property.favorite\"></icon-favourited-orange>\r\n                </button>\r\n                <button class=\"btn header-button\" [disabled]=\"isLogin\" (click)=\"shareProperty(property.propertyId)\">\r\n                  <icon-share class=\"share\"></icon-share>\r\n                </button>\r\n              </div>\r\n            </div>\r\n            <div class=\"more-info\">\r\n              <div class=\"item\">\r\n                <icon-home-white class=\"house\"></icon-home-white>\r\n                {{property.propertyTypeName}}\r\n              </div>\r\n              <div class=\"item\">\r\n                <icon-bed-white class=\"bed\"></icon-bed-white>\r\n                {{property.noOfBedrooms}} Beds\r\n              </div>\r\n              <div class=\"item\">\r\n                <icon-bath-white class=\"baths\"></icon-bath-white>\r\n                {{property.noOfBathrooms}} Baths\r\n              </div>\r\n              <div class=\"item\">\r\n                <icon-area class=\"area\"></icon-area>\r\n                {{property.propertyLotSize}} sq. ft.\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class=\"property-image-actions\">\r\n            <span class=\"property-arrows left\" (click)=\"slickModal.slickPrev()\"></span>\r\n            <span class=\"property-arrows right\" (click)=\"slickModal.slickNext()\"></span>\r\n          </div>\r\n        </div>\r\n        <div class=\"property-info\">\r\n          <div class=\"main-info\">\r\n            <div>\r\n              <p class=\"ellipse\">{{property.propertyName}}</p>\r\n              <div class=\"flag-info\">\r\n                <img [src]=\"property.flagImagePath\">\r\n                <span class=\"ellipse\">{{property.locationName}}</span>\r\n              </div>\r\n            </div>\r\n            <div>\r\n              <div class=\"price-info\" *ngIf=\"!property.showEstimatedPropertyValue\">\r\n                <span>$</span>\r\n                <p>{{property.pricePerPart | number: '1.0' }}</p>\r\n              </div>\r\n              <div class=\"price-info upcoming\" *ngIf=\"property.showEstimatedPropertyValue\">\r\n                <span>$</span>\r\n                <p>\r\n                  {{property.estimatedPropertyValueMinFormatted}}-{{property.estimatedPropertyValueMaxFormatted}}\r\n                </p>\r\n              </div>\r\n              <p [ngClass]=\"{'upcoming': property.showEstimatedPropertyValue}\">\r\n                per 1/{{property.totalParts}} share\r\n              </p>\r\n              <!-- <div class=\"chart\">\r\n                <custom-donut-chart [Data]=\"chartObject(property.propertyStatusId, property.totalPartsOwned)\">\r\n                </custom-donut-chart>\r\n              </div>\r\n              <div class=\"price-info\">\r\n                <p>${{property.propertyValue | number: '1.0' }}</p>\r\n                <span>${{property.pricePerPart | number: '1.0'}} per part</span>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"more-info\">\r\n            <div class=\"preview-info\">\r\n              <span>\r\n                <icon-favourited class=\"favorite\"></icon-favourited> Favorited\r\n              </span>\r\n              <span class=\"label ml-1\">{{property.favoriteCount}}</span>\r\n              <span class=\"ml-3\">\r\n                <icon-view class=\"views\"></icon-view> Views\r\n              </span>\r\n              <span class=\"label ml-1\">{{property.viewCountFormatted}}</span>\r\n            </div>\r\n            <div class=\"description-info\" [ngClass]=\"{'mb-3': propertyStatus === 1}\">\r\n              <p *ngFor=\"let item of property.overviewData\">\r\n                {{item}}\r\n              </p>\r\n            </div>\r\n            <p class=\"watch-info\" [ngClass]=\"{'disabled': !property?.propertyVideoUrl}\" [hidden]=\"propertyStatus === 1\"\r\n              (click)=\"playVideo(property.propertyVideoUrl, 'Watch Video')\">\r\n              <icon-video-orange class=\"icon\"></icon-video-orange>\r\n              {{property?.propertyVideoUrl ? 'Watch Video' : ''}}\r\n            </p>\r\n            <button class=\"btn btn-success view\" [ngClass]=\"{ 'grayed': !isLogin }\" [disabled]=\"!isLogin\"\r\n              (click)=\"viewDetails(property.propertyId, !isLogin)\">\r\n              View Details\r\n            </button>\r\n            <div class=\"login-info\">\r\n              <p *ngIf=\"!isLogin\">\r\n                You need to\r\n                <a (click)=\"navigateTo('login')\">login</a>\r\n                or\r\n                <a (click)=\"navigateTo('signup')\">signup</a>\r\n                to view\r\n              </p>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-lg-4 col-md-6 col-sm-12 col-12 property-item placeholder\"\r\n      [hidden]=\"properties && properties.length\">\r\n      <div class=\"property-card\">\r\n        <div class=\"image\">\r\n        </div>\r\n        <div class=\"details\">\r\n          <div class=\"message\">\r\n            <h3>More properties on the way</h3>\r\n            <p>\r\n              Sorry, all of our properties are currently sold out. Our team is busy locating\r\n              suitable properties and we expect the next ones to be available in March 2020.\r\n            </p>\r\n            <p class=\"notified\">\r\n              Create an account to be the first to be notified\r\n            </p>\r\n          </div>\r\n          <button class=\"btn join\" (click)=\"navigateTo('/signup')\">\r\n            Join our waitlist\r\n          </button>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n"

