module.exports = "<link rel=\"stylesheet\" href=\"https://use.fontawesome.com/releases/v5.6.1/css/all.css\"\r\n  integrity=\"sha384-gfdkjb5BdAXd+lj+gudLWI+BXq4IuLW5IT+brZEZsLFm++aCMlF1V92rMkPaX4PP\" crossorigin=\"anonymous\" />\r\n\r\n<!-- Header Banner -->\r\n\r\n<section id=\"headerBannerId\">\r\n  <div class=\"header-banner-container\">\r\n    <div class=\"container\">\r\n      <h3>HOW DO I SELL MY PARTS?</h3>\r\n      <p>\r\n        Sell your parts to other approved investors in just a few easy steps.\r\n      </p>\r\n      <img src=\"assets/selling-exiting/snapshots@2x.png\" class=\"image-size\" />\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<section id=\"statementId\">\r\n  <div class=\"statement-container\">\r\n    <p>\r\n      Please Note - The option to sell a part will only become available after\r\n      you have held <br class=\"line-break\" />\r\n      the part for a minimum of 6 months. This is an SEC requirement.\r\n    </p>\r\n  </div>\r\n</section>\r\n\r\n<!-- Header Banner end -->\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <div class=\"row\">\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-price\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <div class=\"float-right\">\r\n                    <app-number-one-icon></app-number-one-icon>\r\n                  </div>\r\n                  <br />\r\n                  <app-marketplace-icon></app-marketplace-icon>\r\n                  <h3>Choose a price</h3>\r\n                  <p>\r\n                    First, find a comfortable price point. You can use the\r\n                    yearly property valuation to assist you with setting a\r\n                    price, or look at recent sale values of other property\r\n                    parts.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-list-padding\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <div class=\"float-right\">\r\n                    <app-number-two-icon></app-number-two-icon>\r\n                  </div>\r\n                  <br />\r\n                  <app-investors-icon></app-investors-icon>\r\n                  <h3>List on the Platform</h3>\r\n                  <p class=\"paragraph-custom\">\r\n                    Once you have set a price, your parts will be listed on the\r\n                    platform for sale to other approved Accredited Investors.\r\n                  </p>\r\n                  <br />\r\n                  <p>\r\n                    <small>Note - If other investors have also listed parts for sale\r\n                      in the same property, the lowest priced parts will be\r\n                      purchased by investors first.</small>\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-parts-sold-padding\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <div class=\"float-right\">\r\n                    <app-number-three-icon></app-number-three-icon>\r\n                  </div>\r\n                  <br />\r\n                  <app-receiving-icon></app-receiving-icon>\r\n                  <h3>Parts sold</h3>\r\n                  <p>\r\n                    If another investor does purchase one or more of your parts,\r\n                    you will receive an email notification. The proceeds of the\r\n                    sale will go directly into your digital wallet.\r\n                  </p>\r\n                  <p>\r\n                    <small>\r\n                      Note - the usual transaction fee of 1.75% will apply to\r\n                      the sale of any parts.\r\n                      <a routerLink=\"/our-fees\">\r\n                        Please visit the Fees / Costs</a>\r\n                      page for more information\r\n                    </small>\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-withdraw-reinvest\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <div class=\"float-right\">\r\n                    <app-number-four-icon></app-number-four-icon>\r\n                  </div>\r\n                  <br />\r\n                  <app-bank-icon></app-bank-icon>\r\n                  <h3>Withdraw or Re-invest</h3>\r\n                  <p>\r\n                    Once your funds are in your digital wallet, you now have the\r\n                    choice to re-invest them in another property, or withdraw\r\n                    the funds to your bank account.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- <section id=\"footerBannerId\">\r\n  <div class=\"bottom-banner\">\r\n    <div class=\"container\">\r\n      <h3>You can contact the team</h3>\r\n      <p>\r\n          <app-web-logo-icon></app-web-logo-icon> &nbsp; www.keyobby.com &nbsp; | &nbsp; <app-email-logo-icon></app-email-logo-icon> &nbsp; team@keylobby.com &nbsp; | &nbsp; <i class=\"fab fa-facebook-f\"></i> &nbsp; <i class=\"fab fa-twitter\"></i>\r\n      </p>\r\n    </div>\r\n  </div>\r\n</section> -->\r\n"

