module.exports = "<div class=\"why-invest-container\">\r\n  <div class=\"banner\">\r\n    <div class=\"container\">\r\n      <h3>WHY INVEST IN A PROPERTY</h3>\r\n      <p>\r\n        We think investing in Real Estate is a great way to diversify your\r\n        portfolio. Find out more about why you should consider this asset class.\r\n      </p>\r\n    </div>\r\n  </div>\r\n\r\n  <div class=\"container\">\r\n    <div class=\"row d-flex flex-column-reverse flex-lg-row\">\r\n      <div class=\"col-md-6\">\r\n        <h2><strong>Real Estate is simple and easy to understand</strong></h2>\r\n        <p class=\"pr-5\">\r\n          If you read the financial statements of a company you own stock in or\r\n          try to make head and tail of a profit/loss statement for a large\r\n          corporation, you will understand why Real Estate is so much simpler.\r\n        </p>\r\n        <p>\r\n          It is straightforward to calculate income on a Vacation rental\r\n          (Nightly Rate * Occupancy Rate * 365).\r\n        </p>\r\n        <p>\r\n          Once you have taken into account of expenses, you will know your Net\r\n          income, and very quickly your NET yield on the investment. At Partbnb\r\n          we have made it simple and transparent on all of these figures for\r\n          every project.\r\n        </p>\r\n        <br />\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/why-invest/Image1@2x.png\"\r\n          class=\"img-fluid\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/why-invest/Image2@2x.png\"\r\n          class=\"img-fluid\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n      <div class=\"col-md-6 pl-5\">\r\n        <h2>You own a physical Security</h2>\r\n        <p>\r\n          A property is something that you can visit. It is one of the few\r\n          investments where you can physically review your investment, unlike\r\n          stocks where you will likely never see any of the company's physical\r\n          assets\r\n        </p>\r\n        <p>\r\n          Partbnb allows part owners to book and stay at a discounted rate in\r\n          the property that they own. You can go and visit your property and\r\n          even touch the walls if you wish!\r\n        </p>\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row d-flex flex-column-reverse flex-lg-row\">\r\n      <div class=\"col-md-6\">\r\n        <h2>Stability in Income</h2>\r\n        <p>\r\n          Everyone needs a place to live, or in our case a place to stay when\r\n          they are on vacation. While stock markets move up and down, there is\r\n          always a need for accommodation.\r\n        </p>\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/why-invest/Image3@2x.png\"\r\n          class=\"img-fluid\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/why-invest/Image4@2x.png\"\r\n          class=\"img-fluid\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <h2>Long Term Appreciation</h2>\r\n        <p>\r\n          Over the long term, real estate has been shown to rise in price,\r\n          providing capital growth (or gains) to those that own it. Partbnb\r\n          ensures that investors can take advantage of these gains by selling\r\n          their parts on the platform in the future and realizing the\r\n          difference.\r\n        </p>\r\n        <p>\r\n          Of course, prices don't always increase, and there is still a risk\r\n          that over some time the property value may decrease.\r\n        </p>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"container-fluid bottom-banner\">\r\n    <div class=\"row py-5\">\r\n      <div className=\"col-sm-12 col-md-12 col-lg-8 col-xl-8 mx-auto\">\r\n        <h3\r\n          class=\"bottom-banner-header text-center bottom-banner-header text-center m-auto px-5 mb-5\"\r\n        >\r\n          Here's how much the median home value in the U.S. has changed between\r\n          1940 and 2000:\r\n        </h3>\r\n        <img\r\n          class=\"img-fluid d-none d-md-block mx-auto my-5\"\r\n          src=\"assets/img/why-invest/bottom-chart.png\"\r\n        />\r\n        <img\r\n          class=\"img-fluid d-block d-md-none mx-auto my-5\"\r\n          src=\"assets/img/why-invest/bottom-chart-mobile.png\"\r\n        />\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n"

