module.exports = "<section class=\"fees-and-cost-section\">\r\n  <div class=\"container\">\r\n    <div class=\"items row\">\r\n      <div class=\"item acquisition-cost\" [class.active]=\"items[0].active\" (click)=\"select(0)\">\r\n        <h4><span>Property Acquisition Cost</span><img src=\"assets/img/fees-and-costs/accordion.svg\" alt=\"Property Acquisition Cost\"  /></h4>\r\n        <div>\r\n          <h5>Setup / Acquisition Fee</h5>\r\n          <p>To reimburse us for finding your property and preparing it for purchase, we charge a 10% commission on the purchase price of a property, exclusive of stamp duty, legal fees, or any other costs associated with  the sale.</p>\r\n          <h5>Stamp Duty / Transfer Tax</h5>\r\n          <p>Each country has slight variations on the amount that they charge for real estate transactions. You can see typical rates below.</p>\r\n          <table>\r\n            <thead>\r\n              <tr>\r\n                <th></th>\r\n                <th>Buy</th>\r\n                <th>Sell</th>\r\n              </tr>\r\n            </thead>\r\n            <tbody>\r\n              <tr>\r\n                <td><img src=\"assets/img/fees-and-costs/Bahamas.png\" alt=\"Bahamas\" />Bahamas</td>\r\n                <td>5.0%</td>\r\n                <td>5.0%</td>\r\n              </tr>\r\n              <tr>\r\n                <td><img src=\"assets/img/fees-and-costs/Cayman.png\" alt=\"Cayman Islands\" />Cayman Islands</td>\r\n                <td>7.5%</td>\r\n                <td>0.0%</td>\r\n              </tr>\r\n              <tr>\r\n                <td><img src=\"assets/img/fees-and-costs/Dominican.png\" alt=\"Dominican Republic\" />Domincan Republic\r\n                </td>\r\n                <td>3.0%</td>\r\n                <td>0.0%</td>\r\n              </tr>\r\n              <tr>\r\n                <td><img src=\"assets/img/fees-and-costs/Puerto_Rico.png\" alt=\"Puerto Rico\" />Puerto Rico\r\n                </td>\r\n                <td>1.0%</td>\r\n                <td>0.0%</td>\r\n              </tr>\r\n              <tr>\r\n                <td><img src=\"assets/img/fees-and-costs/Turks_and_Caicos.png\" alt=\"Turks & Caicos\" />Turks & Caicos\r\n                </td>\r\n                <td>8-10.0%</td>\r\n                <td>0.0%</td>\r\n              </tr>\r\n            </tbody>\r\n          </table>\r\n          <i>*$250k - $500k is 8%, >$500k is 10%</i>\r\n          <h5>Legal Fees</h5>\r\n          <p>The fees to complete a purchase differ slightly between countries, but are usually less than 1% of the purchase price.</p>\r\n          <h5>Company Creation Fees</h5>\r\n          <p>The formation of a local company is a usual requirement for property acquisition in Caribbean Countries. The usual cost for setting up the local company is $3k - $5k, depending on the country.</p>\r\n        </div>\r\n      </div>\r\n      <div>\r\n        <div class=\"item management-fees\" [class.active]=\"items[1].active\" (click)=\"select(1)\">\r\n          <h4><span>Management Fees</span><img src=\"assets/img/fees-and-costs/accordion.svg\" alt=\"Accordion\"  /></h4>\r\n          <div>\r\n            <strong>1.50% <span>Annually</span></strong>\r\n            <h5>Based on the Property Value</h5>\r\n            <p>Partbnb charges an annual management fee to cover our costs related to conducting the part ownership management structure, platform and all associated activities to ensure your carefree homeownership. This fee also covers our management of short-term rentals.</p>\r\n          </div>\r\n        </div>\r\n        <div class=\"item property-transfer-fees\" [class.active]=\"items[2].active\" (click)=\"select(2)\">\r\n          <h4><span>Property Transfer Fee</span><img src=\"assets/img/fees-and-costs/accordion.svg\" alt=\"Accordion\"  /></h4>\r\n          <div>\r\n            <strong>3.0%</strong>\r\n            <h5>Based on Property Value</h5>\r\n            <p>If an owner wishes to sell his or her part or all owners vote to sell an entire property, the transfer fee will be charged to the seller or sellers as part of the sales process.</p>\r\n          </div>\r\n        </div>\r\n        <div class=\"item transfer-fees\" [class.active]=\"items[3].active\" (click)=\"select(3)\">\r\n          <h4><span>ACH / Wire Transfer Fees</span><img src=\"assets/img/fees-and-costs/accordion.svg\" alt=\"Accordion\"  /></h4>\r\n          <div>\r\n            <img src=\"assets/img/fees-and-costs/icn_bank.svg\" alt=\"ACH / Wire Transfer Fees\" />\r\n            <p>Partbnb may add a fee of 0.5%, up to $5, for ACH payments. There are no fees for receipt of wires, but you should be aware of any costs you may incur with your financial provider.</p>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>"

