module.exports = "<section class=\"how-it-works-steps\">\r\n  <div class=\"\">\r\n    <div class=\"row\">\r\n      <div class=\"items\">\r\n        <div id=\"choose-a-home\" class=\"item left\">\r\n          <div class=\"left\">\r\n            <h4>\r\n              <i>1</i>\r\n              Choose a home</h4>\r\n            <img src=\"assets/img/how-it-works/image4.png\" alt=\"Choose a home\" />\r\n          </div>\r\n          <div class=\"right desc-container\">\r\n            <h4>\r\n              <i>1</i>\r\n              Choose a home</h4>\r\n            <ul>\r\n              <li>\r\n                <h5>Setup your account</h5>\r\n                <p>It takes less than 30 seconds to create an account. You just need to enter your name, email address,\r\n                  and a password.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Review available properties</h5>\r\n                <p>Review photos, videos, walkthroughs, and detailed information about the area in which the property is\r\n                  located. You can also see any new upcoming properties our team will have for sale.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Favorite and share</h5>\r\n                <p>Create a shortlist of your favorites and share them with your friends and family.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Review the owners agreement</h5>\r\n                <p>The example owner’s agreement details how the property will be managed. It describes how Partbnb will\r\n                  act on behalf of owners as manager of the property and covers all rules and the voting process.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Ask us questions</h5>\r\n                <p>Our team is always happy to talk with you. You can connect with us via live chat, phone or in person.\r\n                  You’re welcome to attend our live open homes and meetups, too.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Register your interest in an upcoming property</h5>\r\n                <p>If you’re interested in an upcoming property, register your interest with us, and we’ll make sure\r\n                  you’re one of the first to be notified when it becomes available.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Complete our 5-minute verification process now</h5>\r\n                <p>Make sure you’re ready to buy your Caribbean home.</p>\r\n              </li>\r\n            </ul>\r\n\r\n          </div>\r\n\r\n        </div>\r\n        <div id=\"buy-a-part\" class=\"item right\">\r\n          <div class=\"right\">\r\n            <h4>\r\n              <i>2</i>\r\n              Buy your part of a home</h4>\r\n            <img src=\"assets/img/how-it-works/image2.png\" alt=\"Buy a part\" />\r\n          </div>\r\n          <div class=\"left desc-container\">\r\n            <h4>\r\n              <i>2</i>\r\n              Buy your part of a home</h4>\r\n            <ul>\r\n              <li>\r\n                <h5>Select a home</h5>\r\n                <p>Choose from any homes that are currently available or have a part available for resale.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Choose one or more parts</h5>\r\n                <p>You can select to buy 1 or more parts of the 8 that are available. When you purchase your part or\r\n                  parts, you simply make a 20% deposit via ACH or wire transfer.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Purchase approval process</h5>\r\n                <p>A dedicated account manager will keep you informed of the timeframes and the process to complete your\r\n                  purchase, which includes providing relevant documentation to local government authorities, such as\r\n                  recognized identification, banking references, and character references.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Company formation</h5>\r\n                <p>As required by most islands in the Caribbean, we’ll form a local company in which each of the owners\r\n                  holds a relevant interest. The company will be the titled owner of the property. Partbnb is not\r\n                  included. We’re connected only via a management agreement.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Settlement Pay Stamp Duties / Solicitor Costs / Fees</h5>\r\n                <p>On the date of settlement, you’ll transfer the final remaining funds of the purchase price to the\r\n                  appointed local lawyer or solicitor to complete your purchase. This price includes relevant stamp\r\n                  duties and legal fees, as detailed in the financial breakdown for each property.</p>\r\n              </li>\r\n            </ul>\r\n          </div>\r\n\r\n        </div>\r\n        <div id=\"enjoy-it\" class=\"item left\">\r\n          <div class=\"left\">\r\n            <h4>\r\n              <i>3</i>\r\n              Enjoy it</h4>\r\n            <img src=\"assets/img/how-it-works/image3.png\" alt=\"Enjoy it\" />\r\n          </div>\r\n          <div class=\"right desc-container\">\r\n            <h4>\r\n              <i>3</i>\r\n              Enjoy it</h4>\r\n            <ul>\r\n              <li>\r\n                <h5>Book your initial Priority Stays</h5>\r\n                <p>As soon as the property is available, you’ll be able to book up to 2 weeks of priority stays for the\r\n                  first year. Read more about our convenient prioritization system.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Meet your co-owners</h5>\r\n                <p>You’ll get to meet your co-owners when you have access to the Owners Forum. It's a place where you\r\n                  can discuss issues, vote on decisions, share stories and tips, and make friends.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Access our smart booking calendar</h5>\r\n                <p>Once your priority initial stays are locked in, the smart calendar is opened for all owners to book\r\n                  additional stays to a maximum of 45 days per year per 1/8 share.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Relax, we'll take care of all the details</h5>\r\n                <p>As the appointed property manager, Partbnb will maintain the property, report to you on the finances,\r\n                  organize cleaning between stays, fill vacancies with short-term rentals, and raise issues in the\r\n                  owners forum that require a decision.</p>\r\n              </li>\r\n            </ul>\r\n          </div>\r\n\r\n        </div>\r\n        <div id=\"grow-or-sell\" class=\"item right\">\r\n          <div class=\"right\">\r\n            <h4>\r\n              <i>4</i>\r\n              Enjoy increases in value or sell</h4>\r\n            <img src=\"assets/img/how-it-works/image1.png\" alt=\"Grow or sell\" />\r\n          </div>\r\n          <div class=\"left desc-container\">\r\n            <h4>\r\n              <i>4</i>\r\n              Enjoy increases in value or sell</h4>\r\n            <ul>\r\n              <li>\r\n                <h5>View capital growth updates</h5>\r\n                <p>Partbnb will arrange for a revaluation of the property each year. You’ll have access to the\r\n                  information, so you can track changes in the value of your shared home.</p>\r\n              </li>\r\n              <li>\r\n                <h5>Vote on any major issues</h5>\r\n                <p>In accordance with the owners agreement <a routerLink=\"/owners-agreement\">[link]</a>, a vote is made by the owners on any major issues. An\r\n                  owner can also raise a vote request. In most cases, a majority vote is required to pass a resolution.\r\n                </p>\r\n              </li>\r\n              <li>\r\n                <h5>Sell your part</h5>\r\n                <p>Any owner may request that the part be placed up for resale any time after 12 months of ownership.\r\n                  Partbnb will arrange for the part to be listed on the resale section of the website. A 3% commission\r\n                  is payable to us for facilitating the sale.</p>\r\n                <p>Parts may also be sold privately, but the 3% sales commission is still charged. In the event that a\r\n                  majority of owners wish to sell the property, Partbnb will arrange for a local real estate agent to\r\n                  list and sell the property at or above the most recent valuation.</p>\r\n              </li>\r\n            </ul>\r\n            <div>\r\n            </div>\r\n          </div>\r\n\r\n        </div>\r\n\r\n      </div>\r\n      <!-- <div class=\"row bottom-info\">\r\n        <img src=\"assets/img/how-it-works/Book-image.svg\" alt=\"Buy a part\" />\r\n        <div>\r\n          <h4>Talk to Us about your purchase or any questions you may have</h4>\r\n          <p>Schedule a call with our team and let us know how we may help you.</p>\r\n        </div>\r\n        <a href=\"https://calendly.com/partbnb_loise\" target=\"_blank\" class=\"btn btn-success\">Book a call</a>\r\n      </div> -->\r\n\r\n      <div class=\"contact-info\">\r\n        <div class=\"container\">\r\n          <img src=\"assets/img/how-it-works/Book-image.svg\" alt=\"Buy a part\" />\r\n          <div class=\"contact-wrapper\">\r\n            <h4>Talk to Us about your purchase or any questions you may have</h4>\r\n            <p>Schedule a call with our team and let us know how we may help you.</p>\r\n\r\n            <a href=\"https://calendly.com/partbnb_loise\" target=\"_blank\" class=\"btn btn-success\">Book a call</a>\r\n          </div>\r\n        </div>\r\n      </div>\r\n\r\n    </div>\r\n  </div>\r\n</section>\r\n"

