module.exports = "<section class=\"titled-ownership\">\r\n  <div class=\"container\">\r\n    <h3>Own 1/8th of an expertly selected premium Caribbean home\r\n      – with fully titled ownership. </h3>\r\n    <p>When you travel to the Caribbean, do you wish you could own one of the many stunning seaside homes you’ve seen –\r\n      and wonder if there’s an affordable way to buy one? Now, there is! </p>\r\n    <div class=\"row\">\r\n      <div class=\"ownership-card\">\r\n        <img src=\"assets/img/home/Group_5.png\" alt=\"Owners\" />\r\n        <p>\r\n          For example, Craig’s family purchased 1/8 of a breathtaking beachfront home on Exuma, the Bahamas, at\r\n          Pineapple Bluff in April 2018. Their total partial cost was just $80k for 6 weeks of annual use year after\r\n          year. In the first year, they chose to stay only 3 weeks, and the expert Partbnb team found the perfect\r\n          renters and managed all the details. Craig just enjoyed the rental income!\r\n        </p>\r\n      </div>\r\n\r\n    </div>\r\n    <div class=\"row\">\r\n      <div class=\"items\">\r\n        <div class=\"item\">\r\n          <h4>\r\n            <img src=\"assets/img/home/icn-chart.svg\" alt=\"Part ownership suits your lifestyle\" />\r\n            Part ownership suits your lifestyle\r\n          </h4>\r\n          <p>Why spend to buy an entire vacation home on your own when you’ll never be there the entire year? It’s much\r\n            smarter to buy a 1/8 share or 12.5% of your dream home – and enjoy it up to six weeks a year!\r\n          </p>\r\n        </div>\r\n        <div class=\"item\">\r\n          <h4>\r\n            <img src=\"assets/img/home/icn-ownership.svg\" alt=\"Fully Titled Ownership\" />\r\n            Fully Titled Ownership</h4>\r\n          <p>You own the title, guaranteed! So you’ll feel right at home, benefit from increases in the value of the\r\n            property, and you can sell you fraction whenever you want to. So ownership with Partbnb comes with all the\r\n            conveniences of home ownership and none of the inconveniences of timeshares. </p>\r\n        </div>\r\n        <div class=\"item\">\r\n          <h4>\r\n            <img src=\"assets/img/home/icn-agreement.svg\" alt=\"Perfectly easy paperwork\" />\r\n            Perfectly easy paperwork\r\n          </h4>\r\n          <p>We take care of all the paperwork, including a clear and agreeable Owners Agreement that makes cooperation\r\n            a breeze.</p>\r\n        </div>\r\n\r\n        <div class=\"item\">\r\n          <h4>\r\n            <img src=\"assets/img/home/icn-platform.svg\" alt=\"Convenient booking platform\" />\r\n            Convenient booking platform\r\n          </h4>\r\n          <p>Our smart booking platform is the first ever that enables owners to book stays, communicate with one another easily, even vote on any issues.</p>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <h3 class=\"how-it-works\">Watch How It Works</h3>\r\n    <div class=\"row\">\r\n      <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe\r\n          class=\"embed-responsive-item\"\r\n          src=\"https://www.youtube.com/embed/tsAKB1Pj9n4\"\r\n          frameborder=\"0\"\r\n          allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\"\r\n          allowfullscreen\r\n        ></iframe>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>"

